$(document).ready(function() {


    $("#date1").datepicker($.datepicker.regional['ru']);
    $("#date2").datepicker($.datepicker.regional['ru']);

    // Создать график
    $("button#button-get").bind("click", CreatePlot);

});



// Формирование диаграммы
function CreatePlot(e) {

    $("img#plot").attr("src", " data:image/png;base64,");

    var date1 = $("input#date1").val();
    var date2 = $("input#date2").val();
    var events = $("select#events").val();
    var users = $("select#users").val();

    if (date1 != "" && date2 != "" && (date1 != date2)) {

        var jqxhr = $.getJSON("/working/jsondata/?action=get-data-plot&date1="+date1+"&date2="+date2+"&events="+events+"&users="+users,
        function(data) {

            if (data["result"] == "ok") {

                $("img#plot").attr("src", "data:"+data["data"]);

            }

        })

    }

    else {alert("Задайте диапазон дат.");}

}
